import React from "react";
import { Link } from "react-router-dom";
import './components.css';

function NavBar() {
    return (
        <nav className="navbar navbar-expand-sm sticky-top">
            <div className="container">
                <Link className="navbar-brand" to="/">TRANSLANOVA</Link>

                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#collapsibleNavbar"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse " id="collapsibleNavbar">
                    <ul className="navbar-nav">
                        <li className="nav-item nav-link active"><Link to="/">Home</Link></li>
                        <li className="nav-item nav-link"><Link to="/services">Services</Link></li>
                        <li className="nav-item nav-link"><Link to="/about">About</Link></li>
                        <li className="nav-item nav-link"><Link to="/testimonial">Testimonial</Link></li>
                        <li className="nav-item nav-link"><Link to="/contact">Contact</Link></li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default NavBar;
